import React from 'react';

const Todos = ({todoList}) => {
    return (
        todoList.length ? (   
            <div className='todos collection'>
                {
                    todoList.map(todo => (
                        <div className='collection-item' key={todo.id}>
                            <p>{todo.content}</p>
                        </div>
                    ))
                }
            </div> 
        ) : (
            <p className='center'>You have no todos left, Yipee!</p>
        )
    );
}

export default Todos;
